body.script:
$(document).ready(function () {
  	// replace nav search
	if ($(".nav-search")[0]) {
      $(".nav-search .search-input").attr("name", "minio[query]");
    }

    // hubspot form behavior

    // Legacy form behavior (v3)
    if ($(".hbspt-form")[0]) {
        var capacity = 1;
        var unit = "TiB";
        var capacityTib = 1;

        function convertCapacityToTiB() {
            var multiplier = 1;
            if (unit === "PiB") {
                multiplier = 1024;
            } else if (unit === "EiB") {
                multiplier = 1024 * 1024;
            }
            capacityTib = capacity * multiplier;
            $(".hs_capacity_tib__c input").val(capacityTib);
        }

        window.addEventListener('message', (event) => {
            if (
                event.data.type === 'hsFormCallback' &&
                event.data.eventName === 'onFormReady'
            ) {
                if ($(".trial-license-container")[0]) {
                    $(".trial-license-container em").replaceWith('');
                    $(".trial-license-container strong img").addClass("premium-trial-diamond");
                }

              	if ($(".hs_capacity__unconverted_value_")[0]) {
				  // cover cases where webflow automatically fills out form
                  var inputValue = $(".hs_capacity__unconverted_value_ input").val();

                  if (inputValue === "") {
                    $(".hs_capacity_tib__c input").val(1);
                  } else {
                    var unitValue = $(".hs_capacity_unit select").val();
                    unit = unitValue;
                    capacity = inputValue;
                    convertCapacityToTiB();
                  }
                }

                $(".hs_capacity__unconverted_value_ input").on("input change", function (e) {
                    if (e.target.value) {
                        capacity = e.target.value;
                        convertCapacityToTiB();
                    }
                });

                $(".hs_capacity_unit select").on("change", function (e) {
                    if (e.target.value && e.target.value !== "") {
                        unit = e.target.value;
                        convertCapacityToTiB();
                    }
                });
            }
        });
    }

    // Regular form behavior (v4)
    if ($(".hs-form-html")[0]) {
        var capacity = 1;
        var unit = "TiB";
        var capacityTib = 1;

        function convertCapacityToTiB() {
            var multiplier = 1;
            if (unit === "PiB") {
                multiplier = 1024;
            } else if (unit === "EiB") {
                multiplier = 1024 * 1024;
            }
            capacityTib = capacity * multiplier;
            HubSpotFormsV4.getForms()[0].setFieldValue('0-1/capacity_tib__c', capacityTib.toString());
        }

        window.addEventListener('hs-form-event:on-ready', (event) => {
            // listen to capacity change event
            var capacityElement = document.querySelector("input[name='0-1/capacity__unconverted_value_']");
            var capacityObserver = new MutationObserver(function(mutations) {
                mutations.forEach(function(mutation) {
                    if (mutation.type === "attributes" && mutation.attributeName === "value") {
                        if (mutation.target.value) {
                            capacity = mutation.target.value;
                            convertCapacityToTiB();
                        }
                    }
                });
            });

            capacityObserver.observe(capacityElement, {
                attributes: true
            });

            // listen to unit change event
            var unitElement = document.querySelector("input[name='0-1/capacity_unit']");
            var unitObserver = new MutationObserver(function(mutations) {
                mutations.forEach(function(mutation) {
                    if (mutation.type === "attributes" && mutation.attributeName === "value") {
                        if (mutation.target.value && mutation.target.value !== "") {
                            unit = mutation.target.value;
                            convertCapacityToTiB();
                        }
                    }
                });
            });

            unitObserver.observe(unitElement, {
                attributes: true
            });
        });
    }

});

$(document).ready(function () {
    if ($('[data-chat]')[0]) {
        // Init Chatlio
        function initChatlio(callback, type = 'footer', target = $('[data-chat="footer"]')) {
            var inlineChatText = '';

            if (!$('script#chatlio-widget-embed')[0]) {

                // Add loader
                if (type === 'footer') {
                    var $loader = $('');
                    target.append($loader);
                    target.addClass("inactive");
                }

                if (type === 'inline') {
                    inlineChatText = target.html();
                    target.text('Please wait...');
                }

                // Chatlio function
                window._chatlio = window._chatlio || [];
                !function () {
                    var t = document.getElementById("chatlio-widget-embed");
                    if (t && window.ChatlioReact && _chatlio.init) return void _chatlio.init(t, ChatlioReact);
                    for (var e = function (t) {
                        return function () {
                            _chatlio.push([t].concat(arguments))
                        }
                    }, i = ["configure", "identify", "track", "show", "hide", "isShown", "isOnline", "page", "open", "showOrHide"], a = 0; a < i.length; a++) _chatlio[i[a]] || (_chatlio[i[a]] = e(i[a]));
                    var n = document.createElement("script"), c = document.getElementsByTagName("script")[0];
                    n.id = "chatlio-widget-embed", n.src = "https://w.chatlio.com/w.chatlio-widget.js", n.async = !0, n.setAttribute("data-embed-version", "2.3");
                    n.setAttribute('data-widget-id', 'e0a0ee71-d9d7-419b-7306-119bcaf65d6d');
                    c.parentNode.insertBefore(n, c);
                    n.setAttribute('data-start-hidden', true);

                    callback();
                }();

                window._chatlio.configure({debug: true});

                // Toggle chat toggle button styling based on the window's visibility
                document.addEventListener('chatlio.visibilityChange', function (e) {
                    var visibility = e.data.visibility;

                    if (visibility === 'open') {
                        $('[data-chat="footer"]').addClass('hidden');
                        $('[data-chat="inline"]').addClass('opacity-25 pointer-events-none');

                        if (type === 'inline') {
                            target.html(inlineChatText);
                        }

                        if (type === 'footer') {
                            target.find('.loading').remove();
                            target.removeClass("inactive");
                        }

                        if ($('#chat-loader-body')) {
                            $('#chat-loader-body').fadeOut(300, function () {
                                $(this).remove();
                            });
                        }
                    }
                    else {
                        $('[data-chat="footer"]').removeClass('hidden');
                        $('[data-chat="inline"]').removeClass('opacity-25 pointer-events-none');
                    }

                    // TODO: Adjust cookie consent conditional
                    // if (cookieConsent !== 'accepted') {
                    //     $('#chatlio-widget').addClass('has-cookie-consent');
                    // }
                });

                // Tracking
                document.addEventListener("chatlio.preChatInfoSubmitted", function (event) {
                    var img = document.createElement('img');
                    img.src = '//d.adroll.com/emailc/ADVERTISABLE_EID/PIXEL_EID?' +
                        'adroll_external_data=ipixel%3D1%26adroll_email%3D' +
                        encodeURIComponent(event.data.email);
                    try {
                        __adroll.record_user({ "adroll_segments": "ca1fb842" });
                    } catch (err) { }
                });
            }
            else {
                callback();
            }
        }

        // Chatlio events
        function toggleChatlio() {
            if (window._chatlio) {
                window._chatlio.showOrHide();
            }
        }

        // Toggle Chat window on 'Talk to us' button click
        $('[data-chat]').on('click', function (e) {
            e.preventDefault();

            var $this = $(this);
            var triggerType = $(this).data('chat');

            initChatlio(toggleChatlio, triggerType, $this);
        });
    }
});

// Alert Bar with Versioning

(function () {
  // ====== CONFIG ======
  var SELECTOR = '.site-alert';           // container selector
  var CLOSE_BTN = '.alert-close, [data-alert-close]'; // close button selector(s)
  var COOKIE_DAYS = 60;                   // how long to remember the dismissal
  var COOKIE_PATH = '/';                  // cookie path (use '/' for whole site)
  var VERSION_ATTR = 'data-alert-version';
  var ID_ATTR = 'data-alert-id';
  // ====================

  function setCookie(name, value, days, path) {
    var expires = '';
    if (days) {
      var d = new Date();
      d.setTime(d.getTime() + (days*24*60*60*1000));
      expires = '; expires=' + d.toUTCString();
    }
    document.cookie = name + '=' + encodeURIComponent(value) + expires + '; path=' + (path || '/');
  }

  function getCookie(name) {
    var nameEQ = name + '=';
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
      var c = ca[i].trim();
      if (c.indexOf(nameEQ) === 0) return decodeURIComponent(c.substring(nameEQ.length));
    }
    return null;
  }

  // New: include version in the cookie name so new versions re-show automatically
  function cookieNameFor(id, version) {
    return 'alertDismissed_' + id + '_v' + version;
  }

  function initAlert(alertEl) {
    if (!alertEl) return;

    var id = alertEl.getAttribute(ID_ATTR) || 'default';
    var version = alertEl.getAttribute(VERSION_ATTR) || '1';
    var cookieName = cookieNameFor(id, version);

    // If cookie for THIS version is present, hide immediately
    if (getCookie(cookieName) === '1') {
      alertEl.classList.add('is-hidden');
      alertEl.setAttribute('aria-hidden', 'true');
      return;
    } else {
      alertEl.classList.remove('is-hidden');
      alertEl.removeAttribute('aria-hidden');
    }

    // Wire up close button(s)
    var btn = alertEl.querySelector(CLOSE_BTN);
    if (!btn) return;

    btn.addEventListener('click', function (e) {
      e.preventDefault && e.preventDefault();
      // Hide visually
      alertEl.classList.add('is-hidden');
      alertEl.setAttribute('aria-hidden', 'true');
      // Persist dismissal for THIS version only
      setCookie(cookieName, '1', COOKIE_DAYS, COOKIE_PATH);
    });

    // Optional: also allow any descendant with [data-alert-close] to close
    alertEl.addEventListener('click', function(e){
      var t = e.target && e.target.closest && e.target.closest('[data-alert-close]');
      if (!t) return;
      e.preventDefault();
      alertEl.classList.add('is-hidden');
      alertEl.setAttribute('aria-hidden', 'true');
      setCookie(cookieName, '1', COOKIE_DAYS, COOKIE_PATH);
    });
  }

  // Initialize all matching alerts on the page (supports more than one)
  function initAll() {
    var alerts = document.querySelectorAll(SELECTOR);
    (alerts.forEach ? alerts.forEach(initAlert) : Array.prototype.forEach.call(alerts, initAlert));
  }

  if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', initAll);
  } else {
    initAll();
  }
})();
